import React from "react";
import '../ap';

class Car extends React.Component {
    render() {
      return (
        <div className="App">
 <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>react is {190*10} men {text}</h1>
       
      </header>
      </div>
      )
    }
  }

  export default Car;
